import Navbar from '../components/Navbar.js';
import Hero from '../components/Hero.js';


function Servicios (){
    return(
        <>
        <Navbar />
        <Hero 
        cName="hero-mid"
        heroImg="https://i.postimg.cc/qqBp3KdY/heather-gill-Wlhfy-AHmp-II-unsplash.jpg"
        title="Servicios"
        btnClass="hide"
        />
     </> 
    )
}

export default Servicios;
